    //               Tahsilat
    //             </Link>
    //           </li>
    //           <li className="nav-item">
    //             <Link to="/muhasebe_fis" className="nav-link active">
    //               Muhasebe
    //             </Link>
    //           </li>
    //           <li className="nav-item">
    //             <Link to="/hesap_ekstresi" className="nav-link active">
    //               Hesap Ekstresi
    //             </Link>
    //           </li>
    //           <li className="nav-item">
    //             <Link to="/mizan" className="nav-link active">
    //               Mizan
    //             </Link>
    //           </li>
    //           <li className="nav-item">
    //             <Link to="/stok" className="nav-link disabled">
    //               Stok
    //             </Link>
    //           </li>
    //           <li className="nav-item" >
    //             <Link to="/stok" className="nav-link active mx-start">
    //                Çıkış Yap
    //             </Link>
    //           </li>

    //         </ul>

    //       </div>
    //       </div>
    //     </div>
    //   </nav>

  );
};

export default Navbar;
